import React from 'react';
import SerieCard from './Components/SerieCard/SerieCard';

const SerieList = ({series}) => {
  let output=series.map( (el , i) => (<SerieCard key={i} serie={el}/>) )
  return (
    <div
      style={{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        flexWrap: 'wrap',
      }}
    >
      {output}
    </div>
  );
};

export default SerieList;
